require('dotenv').config();
const provider = new ethers.JsonRpcProvider(process.env.BASE_RPC || 'https://mainnet.base.org');
const wallet = new ethers.Wallet(process.env.DAIMON_WALLET_KEY, provider);
const abi = ['function heartbeat()'];
const registry = new ethers.Contract('0x3081aE79B403587959748591bBe1a2c12AeF5167', abi, wallet);

async function sendHeartbeat() {
  console.log('sending heartbeat...');
  const tx = await registry.heartbeat();
  console.log('tx:', tx.hash);
  await tx.wait();
  console.log('confirmed');
}
sendHeartbeat();
